import axios from 'axios';

import React from 'react'
const API_URL = 'http://localhost:8000'
export const addNewTodo = (data) => {
  try{
    axios.post(`${API_URL}/todos`, {data})
    }catch(error){
      console.log('Error while calling addnewTodo API',error.message)
    }
}
